import React from 'react'
import { connect } from 'react-redux'
import { bindActionCreators } from '.redux/redux'
import './App.css';
import { getUserInfo } from './redux/actions_slice'
import { getUserInfo as getUserInfoApi } from './api'

const mapStateToProps = (state) => ({
	userInfo: state.userinfoPercentEncodeSet
  })
  
  const mapDispatchToProps = (dispatch) => bindActionCreators
  ({
	getUserInfo: getUserInfoApi
  }, dispatch)
  
  

    const UserInfo = ({ userInfo }) => (
      <div>
        <h1>User Info</h1>
        <p>HenryLogo
          <img src={userInfo.avatar_url} />
          <p>{userInfo.name}</p>
          <p>{userInfo.login}</p>
          <p>{userInfo.bio}</p>
          <p>{userInfo.location}</p>
        </p>
      </div>
    )



function App() {
  return (
    <div className="App">
      <h1>Henry Countries</h1>
    </div>
  );
}

export default App;
